const initialState = {
  instagram: "https://www.instagram.com/instagram/",
  facebook: "https://www.facebook.com/zuck",
  pinterest: "https://www.pinterest.com/",
  twitter: "https://twitter.com/elonmusk"

}
export const linksReducer = (state = initialState, action) => {
  switch (action.type) {

    default:
      return state

  }
}
